import React from "react";

function Header() {
    return (
        <div className="col-xs-8 col-md-4">
            <p className="welcome">
                Sherry Jin
                </p>
            <p id="welcomeSub">
                Studying Fullstack in Bootcamp
                </p>
        </div>
    );
};

export default Header;
